const LocationList = () => {
  return (
    <div className="location-list-container">
      <h3>Locations</h3>
      <ul className="location-list-header">
        <li>Name</li>
        <li>Country</li>
        <li>Latitude</li>
        <li>Longitude</li>
        <li>Wind Prob.</li>
        <li>When to go</li>
      </ul>
    </div>
  );
};

export default LocationList;
